function send_message()
{
	var message = $( "#message" ).get(0).value
	if( !message )
	{
		return
	}
	$( "#sendmessage" ).hide()
	$("#message").css("background-image","url(png/239.gif)")
	$("#sending").css("display","inline")
	$.post( "contact.php", "a="+ encodeURI( message ), function( response, status )
	{
		if( status == "success" )
		{
			success()
		} else
		{
			nosuccess("#sendmessage")
		}
	})
	.error( function()
	{
		nosuccess("#sendmessage")
	})
}

function send_register()
{
	var email = $( "#email" ).get(0).value
	$( "#sendemail" ).hide()
	if( !/^.+\@(\[?)[a-zA-Z0-9\-\.]+\.([a-zA-Z]{2,4}|[0-9]{1,3})(\]?)$/.test( email ))
	{
		$( "#sendemail" ).show()
		alert( $( "#eb01" ).get(0).value )
		return
	}
	$.get( "register.php", "a="+email, function( response, status )
	{
		$("#section-register").css("background-image","url(png/240.gif)")
		if( status == "success" )
		{
			success()
		} else
		{
			$("#section-register").css("background-image","none")
			nosuccess("#sendemail")
		}
	})
	.error( function()
	{
		$("#section-register").css("background-image","none")
		nosuccess("#sendemail")
	})
}

function success()
{
	$('#everything').fadeOut(1500, function()
	{
		setTimeout( function()
		{
			$('#success').fadeIn(200, function()
			{
				setTimeout( function()
				{
					window.location.assign('.')
				}, 3000 )
			})
		}, 500 )
	})
}

function nosuccess($who)
{
	$('#message').css('background-image','none')
	$('#sending').hide()
	$($who).show()
	$('#error').show()
}

var browser_type =
{
    is_ios: false,
	is_noflash: false,
	is_oldflash: false,
	is_flash: false,
	assoc: '',
	init: function()
	{
		flash_test = swfobject.getFlashPlayerVersion() .major
		if( this.is_noflash = ( flash_test == 0 ) ){ this.assoc = '#no-flash' }
		if( this.is_oldflash = ( flash_test < 9 )  && !this.is_noflash ){ this.assoc = '#old-flash' }
		this.is_flash = ( flash_test >= 9 )
	    if( this.is_ios = ((navigator.userAgent.match(/iPhone/i)) || (navigator.userAgent.match(/iPod/i))|| (navigator.userAgent.match(/iPad/i)))? true: false ){ this.assoc = '#ios-device' }
	}
}

